package com.hallocasa.vo;

/**
 * Mail Chimp List value object
 * 
 * @author David Mantilla
 *
 */
public class MailChimpList {

    private String name;
    private String id;

    public MailChimpList() {
        // TODO Auto-generated constructor stub
    }

    /**
     * @return the name
     */
    public String getName() {
        return name;
    }

    /**
     * @param name
     *            the name to set
     */
    public void setName(String name) {
        this.name = name;
    }

    /**
     * @return the id
     */
    public String getId() {
        return id;
    }

    /**
     * @param id
     *            the id to set
     */
    public void setId(String id) {
        this.id = id;
    }

}
